import React from 'react';
import Button from '@material-ui/core/Button';
import { useHistory } from "react-router-dom";
const Home = () => {

    const history = useHistory()

    const onclick=()=>{
        history.push("/about")
    }
    return ( 

        <div>

        <h1>Home</h1>
        <h1>This is home Page</h1>

        <Button onClick={onclick}>
            About
        </Button>
        </div>
     );
}
 
export default Home;
